import styled from 'styled-components'

export const Search_warpper =styled.div`
position:relative;
height:140px;
width:1140px;
margin:0 auto;
`
export const Search_img = styled.div`
float:left;
img{
width:190px;
height:120px;
}
`
export const Search_input = styled.div`
position:relative;
input{
position:absolute;
top:30px;
right:0px;
width:488px;
height:32px;
}
`
